'use client'
import React, { useEffect, useState } from 'react'
import { motion } from 'framer-motion'
import { fadeUp, fadeLeft, fadeRight } from '../Home/Animation'

function Header() {
  const [slide, setSlide] = useState(0)
  const [pause, setPause] = useState(false)



  const slides = [
    {
      title: 'Welcome to NIELIT CCC Course Portal',
      desc: 'Your gateway to quality education and exam-focused preparation',
      img0: 'https://icit.in/ccc-course/images/ccc-course-600x200.jpg',
      img2: 'https://media.canva.com/v2/image-resize/format:JPG/height:578/quality:92/uri:ifs%3A%2F%2FM%2F26fe7663-af8f-4b9d-87f3-178250fc3cdb/watermark:F/width:800?csig=AAAAAAAAAAAAAAAAAAAAAFkf-pBTg81M88DA7thkUA6BOl2ginU4NLDciIcEEBre&exp=1769011414&osig=AAAAAAAAAAAAAAAAAAAAAKTvQc3TZv3V_WJjKGvswAAnL2pIH69oCqayBNblxqvF&signer=media-rpc&x-canva-quality=screen',

      sections: [
        {
          title: 'Study Material',
          points: ['MR-1 to MR-5 Notes', 'Chapter-wise MCQs', 'Updated Syllabus'],
        },
        {
          title: 'Practice & Tests',
          points: ['Model Papers', 'Practice Tests', 'Instant Result'],
        },
        {
          title: 'Practical Skills',
          points: ['Live Practical Training', 'Hands-on Practice', 'Real Exam Pattern'],
        },
        {
          title: 'Expert Support',
          points: ['Experienced Faculty', 'Doubt Clearing', 'Exam Guidance'],
        },
      ],
    },
    {
      title: 'Empowering Students for a Brighter Future',
      desc: 'Everything you need to crack CCC in one platform',
      img0: 'data:image/jpeg;base64,',
      img2: 'https://pacebaleswar.in/wp-content/uploads/2023/02/Nielet-Logo.png',
      sections: [
        {
          title: 'Learning Mode',
          points: ['Online Classes', 'Recorded Videos', 'Flexible Timing'],
        },
        {
          title: 'Evaluation',
          points: ['Weekly Tests', 'Performance Analysis', 'Progress Tracking'],
        },
        {
          title: 'Certification',
          points: ['CCC Exam Ready', 'Govt. Recognized', 'Career Boost'],
        },
        {
          title: 'guidance & Support',
          points: ['CCC Exam Ready', 'Govt. Recognized', 'Career Boost'],
        },
      ],
    },
  ]

  useEffect(() => {
    if (pause) return
    const timer = setInterval(
      () => setSlide((p) => (p + 1) % slides.length),
      6000
    )
    return () => clearInterval(timer)
  }, [pause, slides.length])

  return (
    <div
      className="relative w-full bg-neutral-950 bg-center bg-cover"
      style={{
        backgroundImage:
          "url('https://th.bing.com/th/id/OIP.ILVfvVAkx_wFnWwXmW8RUAHaEK?w=290&h=180&c=7&r=0&o=7&pid=1.7&rm=3')",
      }}
    >
      <div className="absolute inset-0 bg-black/50" />

      <header
        className="relative z-10 max-w-7xl mx-auto px-6 py-16"
        onMouseEnter={() => setPause(true)}
        onMouseLeave={() => setPause(false)}
      >
        {/* Navigation */}
        <button
          className="absolute top-1/2 left-4 -translate-y-1/2 bg-white/30 hover:bg-white/60 text-white rounded-full w-10 h-10"
          onClick={() =>
            setSlide((p) => (p - 1 + slides.length) % slides.length)
          }
        >
          
        </button>
        <button
          className="absolute top-1/2 right-4 -translate-y-1/2 bg-white/30 hover:bg-white/60 text-white rounded-full w-10 h-10"
          onClick={() => setSlide((p) => (p + 1) % slides.length)}
        >
          
        </button>

       
        <motion.h1
          key={slide}
          variants={fadeUp}
          initial="hidden"
          animate="visible"
          className="text-3xl md:text-4xl font-bold text-center text-blue-200"
        >
          {slides[slide].title}
        </motion.h1>

        <motion.p
          variants={fadeUp}
          initial="hidden"
          animate="visible"
          transition={{ delay: 0.2 }}
          className="mt-4 text-center text-amber-600 max-w-2xl mx-auto"
        >
          {slides[slide].desc}
        </motion.p>

     
        <div className="grid grid-cols-1 md:grid-cols-2  gap-10 mt-14 items-center">
          <motion.img
            src={slides[slide].img0}
            variants={fadeLeft}
            initial="hidden"
            animate="visible"
            className="rounded-xl mx-auto max-h-64"
          />
          <motion.img
            src={slides[slide].img2}
            variants={fadeRight}
            initial="hidden"
            animate="visible"
            className="rounded-lg max-w-2xl w-68 mx-auto bg-white p-2"
          />
        </div>

       
        <div className="mt-16 grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
          {slides[slide].sections.map((section, i) => (
            <motion.div
              key={section.title}
              variants={fadeUp}
              initial="hidden"
              animate="visible"
              transition={{ delay: i * 0.15 }}
              className="bg-slate-950 rounded-xl p-6 shadow-lg hover:scale-105 transition"
            >
              <h3 className="font-bold text-lg text-amber-700 mb-3 text-center">
                {section.title}
              </h3>
              <ul className="text-sm text-amber-600 space-y-2">
                {section.points.map((p) => (
                  <li key={p}> {p}</li>
                ))}
              </ul>
            </motion.div>
          ))}
        </div>

       
        <motion.div
          variants={fadeUp}
          initial="hidden"
          animate="visible"
          transition={{ delay: 0.6 }}
          className="mt-16 bg-slate-950 text-4xl p-6 rounded-lg text-center text-blue-200 font-extrabold"
        >
          By Shoaib Lari       +91-9838573904
        </motion.div>
      </header>
    </div>
  )
}

export default Header
